import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
     <div>
      <NavLink >

      </NavLink>
      <div className="flex flex-row justify-between">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.vecteezy.com%2Ffree-vector%2Fcoding-logo&psig=AOvVaw1fomFI1jCGSBnbhHEVjG90&ust=1681473367751000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCNjCk8jmpv4CFQAAAAAdAAAAABAE" alt="" />
        <div>
          <p>Home</p>
          <FaShoppingCart/> 
        </div>

      </div>
     </div>
  )
};

export default Navbar;
